    <div className='home'>
      <header className='home__head'>
        <div className='head__menu-icon'>
          <span className='menu-icon__icon material-symbols-outlined'>
            menu
          </span>
        </div>
        <div className='head__searcher'>
          <input type='text' placeholder='Buscar servicio'></input>
          <button></button>
        </div>
      </header>
    </div>
  );
}

